import React from "react";
import styled from "styled-components";
import Logo from "../assets/logo.svg";

const Nav = () => {
  const Wrapper = styled.div`
    display: flex;
    flex-direction: row;
    align-items: center;
    background-color: #05102a;
  `;

  const OctopusLogo = styled.img`
    height: 20px;
  `;

  return (
    <Wrapper>
      <h1>Hello World</h1>
      <OctopusLogo src={Logo} />
    </Wrapper>
  );
};

export default Nav;
